arm:ProgrammingCode.arm:Code:
*----- Frequency distribution -----*
proc freq data=ADSL noprint;
    tables variable#1*ACTARM / out=OUTDS;
run;

variable#1 is as below,
Gender: SEXN
Age: AGEGR1N
Height (at screening): HTBLGR1N
Weight (at screening): WTBLGR1N
BMI (at screening): BMIGR1N
Race: RACEN
Asian-detail: COUNTRY
Medical history: OCMHFL
Concurrent disease: OCCDFL

*----- Summary statistic -----*
proc univariate data=ADSL noprint;
    var variable#2;
    by ACTARM;
    output out=OUTDS mean=mean std=std median=median min=min max=max;
run;

variable#2 is as below,
Age: AGE
Height (at screening): HEIGHTBL
Weight (at screening): WEIGHTBL
BMI (at screening): BMIBL

*----- TEAEs -----*
proc freq data=ADAE noprint;
    tables STUDYID /out=OUTDS;
    by TRTAN;
    where AOCCFL eq "Y";
run;

*----- TEAEs by Grade -----*
proc freq data=ADAE noprint;
    tables STUDYID /out=OUTDS;
    by TRTAN ATOXGRN;
    where AOCCIFL eq "Y";
run;

*----- SOC -----*
proc freq data=ADAE noprint;
    tables STUDYID /out=OUTDS;
    by TRTAN AEBODSYS AEBDSYCD;
    where AOCCSFL eq "Y";
run;

*----- SOC by Grade -----*
proc freq data=ADAE noprint;
    tables STUDYID /out=OUTDS;
    by TRTAN ATOXGRN AEBODSYS AEBDSYCD;
    where AOCCSIFL eq "Y";
run;

*----- PT -----*
proc freq data=ADAE noprint;
    tables STUDYID /out=OUTDS;
    by TRTAN AEBODSYS AEBDSYCD AEPTCD AEDECOD;
    where AOCCPFL eq "Y";
