*----- PT by Grade -----*
proc freq data=ADAE noprint;
    tables STUDYID /out=OUTDS;
    by TRTAN ATOXGRN AEBODSYS AEBDSYCD AEPTCD AEDECOD;
    where AOCCPIFL eq "Y";
run;

proc mixed data=ADPP;
    by PARAMN;
    class group# SUBJID APERIOD TRTAN;
    model AVAL =  group# APERIOD TRTAN / ddfm = satterth;
    random SUBJID(group#);
    lsmeans TRTAN / pdiff=control('1') cl alpha=0.1;
run;

group# is the following derivation:
1, if ACTARM = "Cohort 01"
2, if ACTARM = "Cohort 02"
3, if ACTARM = "Cohort 03"

proc mixed data=ADPP;
    by PARAMN;
    class group#1 SUBJID APERIOD treatment#2;
    model AVAL =  group#1 APERIOD treatment#2 / ddfm = satterth;
    random SUBJID(group#1);
    lsmeans treatment#2 / pdiff=control('1') cl alpha=0.1;
run;

group#1 is the following derivation:
1, if ACTARM = "Cohort 01"
2, if ACTARM = "Cohort 02"
3, if ACTARM = "Cohort 03"

treatment#2 is the following derivation:
1, if TRTAN = 2
2, if TRTAN = 3
3, if TRTAN = 1
